import React, { Component } from 'react'
import style from './Third.module.css'
import picDhamaaal from './dhamaal.png'
import piclaptop from './laptop.png'
import picMobile from './mobile.png'
class Third extends Component {
  left="<";
  right=">";
  render() {
    console.log(this.arr)
    return (
        <div id={style.third} className={style.slider}>
        <span id="slide-1"></span>
        <span id="slide-2"></span>
        <span id="slide-3"></span>
        <div class="container">
          <img src={picMobile} className={style.slide} width="500" height="300" />
          <img src={piclaptop} className={style.slide} width="500" height="300" />
          <img src={picDhamaal} className={style.slide} width="500" height="300" />
        </div>
      </div>
    )
  }
}

export default Third
